private String mutilateTitleScope(String href) {
    if (StringUtils.isNotEmpty(href)) {
        String[] titles = href.split("\\s+");
        if (titles.length > 1) {
            StringBuilder builder = new StringBuilder(titles[0]);

            for (int i = 1; i < titles.length; ++i) {
                builder.append("%20").append(titles[i]);
            }

            return builder.toString();
        }

        return href;
    }

